import SpotifyPlayer from 'react-spotify-player';

const player = () => {
  return (
    <SpotifyPlayer
      uri='spotify:album:6bCnbjqqRgcPCpJwcnoLju'
      size={{
        width: '50%',
        height: 500,
      }}
      view={'list'}
      theme={'black'}
      align='center'
    />
  );
};
export default player;
